import React from 'react';
import Card from '../Components/designstype';
import './Aridesigsncard.css';
import Navbar from '../Components/Navbar';

// Assuming you have an array of category names
const categoryNames = ["Emproidry", "Bridel", "Salwar", "Category4", "Category5", "Category6"];

function App() {
  return (
    <>
      <Navbar />
      <div className="App">
        <h1> <span> Products</span></h1>
        <div className="card-container">
          {categoryNames.map((category, index) => (
            <Card
              key={index}
              title={category}
              content={`This is some sample content for ${category}.`} // Assuming content is fixed
              imageUrl={`https://via.placeholder.com/150?text=${category}`} // Using placeholder URL with category name
            />
          ))}
        </div>
      </div>
    </>
  );
}



export default App;
